Return values can be though as return of ownership too. The ownership of a variable follows the same pattern every time: assigning a value to another variable moves or copies it. pro main(): int = { var s1 = givesOwnership(); // the variable $s1 is given the ownership of the procedure's $givesOwnership return .echo(s1) // prints "hi" var s2 = returnACopy(); // the variable $s2 is given the ownership of the procedure's $returnACopy return .echo(s2) // prints: "there"
