pro givesOwnership(): str = { // This procedure will move its return value into the procedure that calls it @var someString = "hi"; // $someString comes into scope return someString // $someString is returned and MOVES out to the calling procedure
}
pro returnACopy(): int = { // This procedure will move its return value into the procedure that calls it var anotherString = "there" // $anotherString comes into scope return anotherString // $anotherString is returned and COPIES out to the calling procedure
} When a variable that includes data on the heap goes out of scope, the value will be cleaned up automatically by .de_alloc() unless the data has been moved to be owned by another variable, in this case we give the ownership to return value. If the procedure with the retun value is not assigned to a variable, the memory will be freed again. We can even do a transfer of ownership by using this logic: pro main(): int = { @var s2 = "hi"; // $s2 comes into scope (allocatd in the heap) var s3 = transferOwnership(s2); // $s2 is moved into $transferOwnership procedure, which also gives its return ownership to $s3 .echo(s3) // prints: "hi" .echo(s2) // this throws an error, $s2 is not the owner of anything anymore
} pro transferOwnership(aString: str): str = { // $aString comes into scope return aString // $aString is returned and moves out to the calling procedure
} This does not work with borrowing though. When a variable is lended to a procedure, it has permissions to change, but not lend to someone else. The only thing it can do is make a .deep_copy() of it: pro main(): int = { @var s2 = "hi"; // $s2 comes into scope (allocatd in the heap) var s3 = transferOwnership(s2); // $s2 is moved into $transferOwnership procedure, which also gives its return ownership to $s3 .echo(s3) // prints: "hi" .echo(s2) // prints: "hi" too
} pro transferOwnership((aString: str)): str = { // $aString comes into scope which is borrowed return aString // $aString is borrowed, thus cant be lended to someone else // thus, the return is a deep_copy() of $aString
