} The number of map elements is called its length. For a map aMap, it can be discovered using the built-in function .len and may change during execution To add a new element, we use name+[element] or addfunction: .echo(.len(aMap)) // prints: 3
aMap.add( {"IT",55} )
aMap+[{"RU",24}]
.echo(.len(aMap)) // prints: 4 The comparison operators == and != must be fully defined for operands of the key type; thus the key type must not be a function, map, or sequence. {{% notice tip %}} Maps are a growable containers too, thus if not allocated in heap but in stack, the size will be defined automatically in compile time and will be changet to static containers {{% /notice %}}
